import './App.css';
import { useEffect } from 'react';

function App() {
  useEffect(() => {
    console.log(" Hey, I've loaded up");
    fetch("http://localhost:8080/api/todoItems")
      .then((response) => response.json())
      .then((todoItems) => {
        console.log(" Todo items list: ", todoItems);
      });
  });
  return <div> Hey! this is my app </div>
}
export default App;
